import React from 'react';
import Typist from '../../utils/img/typist.svg';

import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import FreeBreakfastIcon from '@material-ui/icons/FreeBreakfast';
import KeyboardIcon from '@material-ui/icons/Keyboard';

const FirstThingYouFace = props => {
	return (
		<Grid container className='container' alignItems='center' justify='center'>
			<Grid item container className='right' xs={6}>
				<Grid item>
					<h1 className='heading'>تیز سفارش بده. تیز تحویل بگیر.</h1>
				</Grid>
				<Grid item>
					<Button
						variant='contained'
						startIcon={<KeyboardIcon />}
						color='primary'
						size='large'
						style={{ marginRight: '10px' }}
					>
						انجام پروژه
					</Button>
					<Button
						variant='contained'
						startIcon={<FreeBreakfastIcon />}
						color='primary'
						size='large'
					>
						سفارش تایپ
					</Button>
				</Grid>
			</Grid>
			<Grid item container className='left' xs={6}></Grid>
		</Grid>
	);
};

export default FirstThingYouFace;
